// refered to https://discuss.leetcode.com/topic/87483/c-code-o-n-beats-100
class Solution {
public:
    int arrayPairSum(vector<int>& nums) {
        vector<int> hashtable(20001, 0);    // use vector's fill constructor, each element is 0
        for (int i = 0; i < nums.size(); i++) {
            hashtable[nums[i]+10000]++;
        }
        bool paired = true;
        int sum = 0;
        for (int i = 0; i < hashtable.size(); i++) {
            if (hashtable[i] >= 1) {
                if (paired) {
                    sum = sum + (hashtable[i] + 1) / 2 * (i - 10000);
                } else {
                    sum = sum + hashtable[i] / 2 * (i - 10000);
                }
                if (hashtable[i] % 2 != 0) {
                    paired = !paired;
                }
            }
        }
        return sum;
    }
};

